import "./About.css";

fetch('"https://restcountries.com/v3.1/all"')
    .then(response => response.json())
    .then(json => console.log(json))

export function About(): JSX.Element {
    return (
        <div className="About">



<button className="navLinkBtn" id="searchButton">
                    <NavLink to="/about">Click To See The World</NavLink>
                </button>
        </div>
    );
}
